import { useEffect, useState } from 'react'
import axios from 'axios'

const App = () => {
    const [newValue, setNewValue] = useState('')
    const [results, setResults] = useState([])

    const handleInput = (event) => {
        setNewValue(event.target.value)
        setResults([])
    }

    useEffect(() => {
        if (newValue) {
            axios
            .get(`https://restcountries.com/v3.1/all`)
            .then(response => {
                const all = response.data.map(one => one.name)
                const search = all.filter(one => one.common.match(new RegExp(newValue, "i")))
                setResults(search)
                console.log(search.map(one => one.common))
            })
        }

    }, [newValue])

    return (
        <div>
            find countries <input
            value={newValue}
            onChange={handleInput}/>
        </div>
    )
}


export default App
